import React from "react";
import  ReactDOM  from "react-dom";
import App from "./components/App";
import cars from "./components/practice";


const [hondacity,Tesla] = cars;

const{speedstaus:{topspeed : hondacityspeed }} = hondacity;
const{speedstaus:{topspeed : Teslaspeed }} = Tesla;
const{color:[hondacolor]} = hondacity;
const{color:[Teslacolor]} = Tesla;


ReactDOM.render(
    <div>
    <table>
        <tr>
            <th>Model</th>
            <th>Top speed</th>
            <th>Top color</th>
        </tr>
        <tr>
            <td>{hondacity.name}</td>
            <td>{Teslaspeed}</td>
            <td>{hondacity.color}</td>
        </tr>
        <tr>
            <td>{Tesla.name}</td>
            <td>{hondacityspeed}</td>
            <td>{Tesla.color}</td>
        </tr>
    </table>
    </div>

,document.getElementById("root"));
